import { Container, Nav, NavDropdown, Navbar, sticky } from "react-bootstrap";
// import { ReactComponent as Logo } from "../img/logo.svg";
import "../img/logo.svg";
import "../Styles.css";
import "../rsmenu.css";

function Header() {
  return (
    <Navbar collapseOnSelect expand="lg" Sticky="top" className="love" top variant="dark">
    <Container>
    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    <Navbar.Collapse id="responsive-navbar-nav">
      <Nav className="m-auto">
        <Nav.Link href="#features">About us</Nav.Link>
        <NavDropdown title="Products" id="collasible-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Giftcards</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Refill </NavDropdown.Item>
        </NavDropdown>
        <NavDropdown title="Resources" id="collasible-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Faq</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">learn</NavDropdown.Item>
        </NavDropdown>
      </Nav>
      <Nav>
        <Nav.Link href="#deets">Login</Nav.Link>
        <Nav.Link href="#memes">
          Register
        </Nav.Link>
      </Nav>
    </Navbar.Collapse>
    </Container>
  </Navbar>
  );
}

export default Header
